import React from 'react'
import { useGetAllProductsQuery } from '../features/productAPI'
import "../CSS/Homescreen.css"


function Homescreen() {
  const {data} = useGetAllProductsQuery()
  return (
    <div>
      {data?.map(product => <div key={product.id}>
        <h3></h3>
      </div>)}
    </div>
   
       
  )
  
      
        


}

export default Homescreen
